const controller = require('./controllers');
const router = require('express').Router();

router.get('/products', controller.products.getProducts);
router.get('/products/:product_id', controller.products.getProduct);
router.get('/reviews', controller.reviews.getReviews);
router.get('/reviews/meta/:product_id', controller.reviews.getMetaData);
router.post('/reviews', controller.reviews.postReview);
router.put('/reviews/:review_id/helpful', controller.reviews.markAsHelpful);
router.put('/reviews/:review_id/report', controller.reviews.reportReview);
router.put('/reviews/:review_id/cancelReport', controller.reviews.cancelReport);

module.exports = router;

module.exports = Queue

function Queue() {
  let xs = []
  let index = 0

  return {
    get length() {
      return xs.length - index
    },
    push: (x) => xs.push(x),
    peek: () => xs[index],
    shift: () => {
      const out = xs[index++]

      if (index === xs.length) {
        index = 0
        xs = []
      } else {
        xs[index - 1] = undefined
      }

      return out
    }
  }
}

const sql = require('../../db/index.js');

module.exports = {
  selectProducts: async function(page, count, callback) {
    try {
      if (!count) count = 5;
      const products = await sql`
        select id, name, slogan, description, category, default_price from product limit ${count};
      `
      callback(null, products);
    } catch (err) {
      callback(err, null);
    }
  },
  selectProduct: async function(product_id, callback) {
    try {
      const product = await sql`
        SELECT id, name, description, category, default_price
        FROM product
        WHERE product.id = ${product_id}
      `
      callback(null, product)
    } catch (err) {
      callback(err, null)
    }
  }
}

const model = require('../models');

module.exports = {
  getProducts: function(req, res) {
    const page = req.body.page;
    const count = req.body.count;
    model.products.selectProducts(page, count, (err, products) => {
      if (err) console.error(err);
      else res.status(200).send(products);
    })
  },
  getProduct: function(req, res) {
    let {product_id} = req.params;
    product_id = Number(product_id);
    model.products.selectProduct(product_id, (err, product) => {
      if (err) {
        console.error(err)
        res.status(404)
      } else {
        res.status(200).send(product);
      }
    })
  }
}
